const homee = () => {
return (
	<div
	style={{
		display: 'flex',
		justifyContent: 'center',
		alignItems: 'center',
		height: '100vh'
	}}
	>
	<h3>Welcome to Ramdeobaba Webdevelopment Team</h3>
	</div>
);
};

export default homee;
